import React,{useState} from 'react';
import TopNavSimpleLogin from '../components/Navbar/TopNavSimpleLogin';
import { useNavigate } from 'react-router-dom';

const SignUp = () => {
    const history = useNavigate();
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [repeatPassword, setRepeatPassword] = useState('');
    function handleClick() {
      history('/login');
    }

    const userData = localStorage.getItem('userData');
if (userData) {
  // Data exists
  const parsedUserData = JSON.parse(userData);
  console.log('User data:', parsedUserData);
  // Perform further actions with the user data
} else {
  // Data does not exist
  console.log('User data not found in localStorage');
  // Handle the case where data is not present
}
    function main() {
        const userData = {
            firstName,
            lastName,
            email,
          };
        localStorage.setItem('userData', JSON.stringify(userData));
        history('/main');
      }
      return (
        <div className='full_div'>
          <TopNavSimpleLogin />

          <center>
            <h1>Create an account to get started on MarketPlants!</h1>
          </center>
          <center>
            <div
              style={{
                border: '2px solid green',
                padding: '20px',
                borderRadius: '10px',
                boxSizing: 'border-box',
                marginLeft: '40%',
                marginRight: '40%',
              }}
            >
              <div>
                <h3 style={{ marginBottom: 0 }}>First Name: </h3>
                <input
                  type='text'
                  style={{
                    backgroundColor: '#f2f2f2',
                    borderRadius: '5px',
                    border: 'none',
                    padding: '10px',
                    marginBottom: '10px',
                  }}
                  value={firstName}
                  onChange={(e) => setFirstName(e.target.value)}
                />
              </div>
              <div>
                <h3 style={{ marginBottom: 0 }}>Last Name</h3>
                <input
                  type='text'
                  style={{
                    backgroundColor: '#f2f2f2',
                    borderRadius: '5px',
                    border: 'none',
                    padding: '10px',
                    marginBottom: '10px',
                  }}
                  value={lastName}
                  onChange={(e) => setLastName(e.target.value)}
                />
              </div>
              <div>
                <h3 style={{ marginBottom: 0 }}>Email</h3>
                <input
                  type='text'
                  style={{
                    backgroundColor: '#f2f2f2',
                    borderRadius: '5px',
                    border: 'none',
                    padding: '10px',
                    marginBottom: '10px',
                  }}
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                />
              </div>
              <div>
                <h3 style={{ marginBottom: 0 }}>Password</h3>
                <input
                  type='password'
                  style={{
                    backgroundColor: '#f2f2f2',
                    borderRadius: '5px',
                    border: 'none',
                    padding: '10px',
                    marginBottom: '10px',
                  }}
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                />
              </div>
              <div>
                <h3 style={{ marginBottom: 0 }}>Repeat Password</h3>
                <input
                  type='password'
                  style={{
                    backgroundColor: '#f2f2f2',
                    borderRadius: '5px',
                    border: 'none',
                    padding: '10px',
                    marginBottom: '10px',
                  }}
                  value={repeatPassword}
                  onChange={(e) => setRepeatPassword(e.target.value)}
                />
              </div>
              <div>
                <button
                  style={{
                    backgroundColor: '#6B8E23',
                    color: 'white',
                    padding: '10px 20px',
                    fontSize: '20px',
                    borderRadius: '5px',
                    border: 'none',
                    cursor: 'pointer',
                  }}
                  onClick={main}
                >
                  Register
                </button>
              </div>
            </div>
            <div>
              <h2 style={{ marginTop: 20 }}>
                Or Login if you have an account:{' '}
                <button
                  style={{
                    backgroundColor: '#6B8E23',
                    color: 'white',
                    padding: '5px 20px',
                    fontSize: '20px',
                    borderRadius: '5px',
                    border: 'none',
                    cursor: 'pointer',
                  }}
                  onClick={handleClick}
                >
                  Login
                </button>
              </h2>
            </div>
          </center>

          <div
            style={{
              marginTop: '50px',
              width: '100%',
              height: '100px',
              backgroundColor: '#6B8E23',
            }}
          ></div>
        </div>
      );
    };

    export default SignUp;
